const Example = () => {

  const [val, setVal] = useState('hello');
  return (
    <>
      <input 
      type="text"
      onChange={(e)=>{
        const setFn = val[1];
        setFn(e.target.value)
      }}/> = {val[0]}
    </>
  );
};

export default Example;
